CREATE VIEW "public"."runs_view" AS SELECT c.region,
    lower((c.district)::text) AS district,
    lower((c.village_assigned)::text) AS village,
    c.name AS contact_name,
    c.urn AS contact_phone,
    r.head_of_house,
    r.is_there_a_latrine AS has_latrine,
    r.does_it_have_a_lockable_door AS has_lockable_door,
    r.does_it_have_brick_wall AS has_brick_wall,
    r.does_the_latrine_have_a_cemented_floor AS has_cemented_floor,
    r.has_iron_sheet_roof,
    r.does_it_have_a_bathroom_next_to_it AS has_adjacent_bathroom,
    r.place_for_hand_washing AS has_handwash_place,
    r.container_for_hand_washing AS has_handwash_container,
    r.is_there_soap AS has_soap,
        CASE
            WHEN ((r.kinyesi_kuzunguka_nyumba = 'No'::text) AND (r.kinyesi_ukutani = 'No'::text)) THEN 'Yes'::text
            ELSE 'No'::text
        END AS clean_latrine,
    r.kinyesi_kuzunguka_nyumba,
    r.kinyesi_ukutani,
    r.created_on AS visited_at
   FROM (runs r
     LEFT JOIN contacts c ON (((r.contact_uuid)::text = (c.uuid)::text)));
